import { useState } from "react";
export default function PokemonList({ pokemons, news }){
    const [current_w, setCurrent_w] = useState([]);
    console.log(pokemons.current_weather);
    setCurrent_w(pokemons.current_weather);
    return(
        <div>
            {current_w?.map((value, index) => (
                <div key={index}>
                    <p>{value.name}</p>
                </div>
            ))}
        </div>
    );
}
